import React from "react";
import Loader from "../../components/Loader/Loader";
import dataMainTitle from "../../data/Home/main-title-data.json";
import HeaderOne from "../../components/Header/HeaderOne";
import TravelSlider from "../../components/Hero/TravelAgency/TravelSlider";
import ImageCarousel from "../../components/Carousel/ImageCarousel";
import WhyChooseTravel from "../../components/WhyChooseUs/TravelAgency/WhyChooseTravel";
import WelcomeTravel from "../../components/WelcomeSection/TravelAgency/WelcomeTravel";
import GalleryTravel from "../../components/Gallery/TravelAgency/GalleryTravel";
import ContactTravel from "../../components/ContactUs/TravelAgency/ContactTravel";
import FooterOne from "../../components/Footer/FooterOne";
import ImageSlider from "../../components/KinderGarden/ImageSlider";
import TopMainTitle from "../../components/KinderGarden/TopMainTitle";

const KinderGarden = () => (
  <Loader>
    <HeaderOne />
    <TopMainTitle data={dataMainTitle} />
    <ImageSlider />
    <ContactThree />
      <section className="pt-0 pb-0 map-section">
        <Map classAppend="wide" />
      </section>
    <FooterOne />
  </Loader>
);

export default KinderGarden;
